import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import "../css/newfilm.css";
import { Button, Col, Container, Row } from "react-bootstrap";

const Blogpage = () => {
  return (
    <>
      <Header />
      <Container>
        <Row>
          <Col>
            <Row>
              <Col>
                <h2>All Articles</h2>
              </Col>
              <Col>
                <Button>search</Button>
              </Col>
            </Row>
          </Col>
          <Col>
            <Row>
              <h2>Recent Posts</h2>
            </Row>
            <Row>
              <h2>Tags</h2>

            </Row>
          </Col>
        </Row>
      </Container>
      <Footer />
    </>
  );
};

export default Blogpage;
